import React, { Component } from 'react';
import './Header.css'
import Logo from '../Header/img/E.svg';


class Header extends Component {
    render() {
        return (
            <div>
                <div className="navbar navbar-expand-lg  bg-tranparent " >
                    <div class="container-fluid"  >
                        <div class="row" >
                            <div class="col-5">
                             <a href="/"><h5>Elderly</h5></a>
                            </div>

                        </div>

                    </div>

                </div>
            </div>
        );
    }

}
export default Header;
